import React from "react";

import classes from "./MoviesList.module.css";
import User from "./User";

const UserList = (props) => {
  return (
    <ul className={classes["movies-list"]}>
      {props.User.map((User) => (
        <User
          key={User.id}
          Name={User.Name}
          userType={User.userType}
          email={User.email}
          phone={User.phone}
        />
      ))}
    </ul>
  );
};

export default UserList;
